(23, 1, 0, 'khuyen-mai', 'khuyen mai', 'abc', 'Mô tả khuyến mãi', '<p>abc</p>', 0, '2015-04-14 18:36:51', '', 2, 'a:6:{s:6:"avatar";s:20:"748667039_bg_new.jpg";s:6:"photos";a:0:{}s:6:"videos";a:0:{}s:5:"files";a:0:{}s:11:"user_upload";s:8:"hungphat";s:11:"user_update";s:8:"hungphat";}', 1, 0),
(24, 1, 0, 'thiet-ke-tien-nghi-ma-tiet-kiem-trong-can-ho-gia-dinh-tre', 'Thiết kế tiện nghi mà tiết kiệm trong căn hộ gia đình trẻ', 'can ho gia dinh, thiet ke dep, nha dep, tien nghi', 'can ho gia dinh, thiet ke dep, nha dep, tien nghi', '<div class=\\"title_news\\" style=\\"margin: 10px 0px 0px; padding: 0px 0px 10px; width: 660.015625px; float: left; font-family: arial; font-size: 12px; line-height: normal;\\">\r\n<h1>Thiết kế tiện nghi m&agrave; tiết kiệm trong căn hộ gia đ&igrave;nh trẻ</h1>\r\n</div>\r\n\r\n<div class=\\"short_intro txt_666\\" style=\\"margin: 0px; padding: 0px 0px 10px; color: rgb(68, 68, 68); font-weight: 700; font-stretch: normal; font-size: 14px; line-height: 18px; font-family: arial; width: 660.015625px; float: left; text-rendering: geometricPrecision;\\">Căn nh&agrave; 3 ph&ograve;ng ngủ ở huyện Nh&agrave; B&egrave;, TP HCM, của một gia đ&igrave;nh trẻ được cải tạo lại c&aacute; t&iacute;nh nhưng vẫn đảm bảo c&ocirc;ng năng tiện dụng.</div>\r\n\r\n<div class=\\"short_intro txt_666\\" style=\\"margin: 0px; padding: 0px 0px 10px; color: rgb(68, 68, 68); font-weight: 700; font-stretch: normal; font-size: 14px; line-height: 18px; font-family: arial; width: 660.015625px; float: left; text-rendering: geometricPrecision;\\"><img src=\\"/upload/P-P-Art-Wall-01-1430729992_660x0 (1).jpg\\" /></div>\r\n\r\n<div class=\\"width_common space_bottom_20\\" style=\\"margin: 0px 0px 20px; padding: 0px; width: 660.015625px; float: left; color: rgb(0, 0, 0); font-family: arial; font-size: 12px; line-height: normal;\\">\r\n<div class=\\"block_content_slide_showdetail\\" style=\\"margin: 0px; padding: 0px;\\">\r\n<div id=\\"article_content\\" style=\\"margin: 0px; padding: 0px;\\">\r\n<div class=\\"item_slide_show\\" style=\\"margin: 0px auto 10px; padding: 0px; clear: both; width: 660.015625px;\\">\r\n<div class=\\"block_thumb_slide_show\\" style=\\"margin: 0px; padding: 0px; width: 660.015625px; float: left; position: relative; text-align: center; font-size: 0px; line-height: 0;\\"><br />\r\n&nbsp;</div>\r\n\r\n<div class=\\"desc_cation\\" style=\\"margin: 0px; padding: 10px 13.1875px; width: 633.609375px; float: left; font-size: 12px; background: rgb(245, 245, 245);\\">\r\n<p>&Yacute; tưởng đầu ti&ecirc;n của KTS Tạ Vĩnh Ph&uacute;c (P+P Design &amp; Construction) v&agrave; chủ nh&agrave; l&agrave; th&aacute;o dỡ hệ trần thạch cao cũ vốn kh&aacute; rối rắm để lộ ra bề mặt trần bề t&ocirc;ng x&aacute;m th&ocirc; r&aacute;p. Ch&iacute;nh điều n&agrave;y gi&uacute;p cho căn hộ c&oacute; được kh&ocirc;ng gian cao v&agrave; tho&aacute;ng hơn nhiều so với th&ocirc;ng thường. Mặc kh&aacute;c, bề mặt vật liệu b&ecirc; t&ocirc;ng trần v&agrave; s&agrave;n gỗ m&agrave;u x&aacute;m cũng tương phản mạnh mẽ với c&aacute;c v&aacute;ch tường v&agrave; vật dụng nội thất m&agrave;u trắng gi&uacute;p tạo n&ecirc;n cảm x&uacute;c thực sự mới lạ v&agrave; đầy c&aacute; t&iacute;nh.</p>\r\n</div>\r\n\r\n<div class=\\"clear\\" style=\\"margin: 0px; padding: 0px; clear: both; font-size: 0px; line-height: 0;\\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\\"item_slide_show\\" style=\\"margin: 0px auto 10px; padding: 0px; clear: both; width: 660.015625px;\\">\r\n<div class=\\"block_thumb_slide_show\\" style=\\"margin: 0px; padding: 0px; width: 660.015625px; float: left; position: relative; text-align: center; font-size: 0px; line-height: 0;\\"><img class=\\"left\\" data-component-caption=\\"&lt;p&gt;\r\n	Công năng sử dụng và tính tiện nghi của căn hộ được nâng cao nhờ vào các giải pháp thiết kế thông minh và tiết kiệm. Phòng khách, phòng ăn và bếp có bố trí mở mang chất hiện đại, phóng khoáng và giàu cảm xúc với bàn ăn màu đỏ là điểm nhấn thị giác ấn tượng.&lt;/p&gt;\\" data-reference-id=\\"22488804\\" id=\\"vne_slide_image_1\\" src=\\"http://c1.f13.img.vnecdn.net/2015/05/04/P-P-Art-Wall-03-1430729993_660x0.jpg\\" style=\\"border:0px; cursor:url(http://st.f1.vnecdn.net/responsive/js/utils/slideshow/css/slideshow/images/icons/zoom_cursor.png), auto; float:none; line-height:0; margin:0px; max-width:100%; padding:0px\\" /><a class=\\"btn_icon_show_slide_show\\" href=\\"http://doisong.vnexpress.net/photo/khong-gian-song/thiet-ke-tien-nghi-ma-tiet-kiem-trong-can-ho-gia-dinh-tre-3208920.html#\\" style=\\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); text-decoration: none; outline: 1px; height: 28px; width: 28px; display: block; position: absolute; right: 0px; top: 0px; background: url(http://st.f3.vnecdn.net/responsive/c/v6/images/graphics/icon_total_01.png) -178px -21px no-repeat;\\">&nbsp;</a></div>\r\n\r\n<div class=\\"desc_cation\\" style=\\"margin: 0px; padding: 10px 13.1875px; width: 633.609375px; float: left; font-size: 12px; background: rgb(245, 245, 245);\\">\r\n<p>C&ocirc;ng năng sử dụng v&agrave; t&iacute;nh tiện nghi của căn hộ được n&acirc;ng cao nhờ v&agrave;o c&aacute;c giải ph&aacute;p thiết kế th&ocirc;ng minh v&agrave; tiết kiệm. Ph&ograve;ng kh&aacute;ch, ph&ograve;ng ăn v&agrave; bếp c&oacute; bố tr&iacute; mở mang chất hiện đại, ph&oacute;ng kho&aacute;ng v&agrave; gi&agrave;u cảm x&uacute;c với b&agrave;n ăn m&agrave;u đỏ l&agrave; điểm nhấn thị gi&aacute;c ấn tượng.</p>\r\n</div>\r\n\r\n<div class=\\"clear\\" style=\\"margin: 0px; padding: 0px; clear: both; font-size: 0px; line-height: 0;\\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\\"item_slide_show\\" style=\\"margin: 0px auto 10px; padding: 0px; clear: both; width: 660.015625px;\\">\r\n<div class=\\"block_thumb_slide_show\\" style=\\"margin: 0px; padding: 0px; width: 660.015625px; float: left; position: relative; text-align: center; font-size: 0px; line-height: 0;\\"><img class=\\"left\\" data-component-caption=\\"&lt;p&gt;\r\n	Phòng khách thoáng rộng và có tầm nhìn đẹp ra cảnh quan bên ngoài. Những chiếc gối lười được sử dụng thay cho sofa phòng khách truyền thống để dễ dàng di chuyển và thân thiện hơn với trẻ nhỏ.&lt;/p&gt;\\" data-reference-id=\\"22488803\\" id=\\"vne_slide_image_2\\" src=\\"http://c1.f14.img.vnecdn.net/2015/05/04/P-P-Art-Wall-02-1430729992_660x0.jpg\\" style=\\"border:0px; cursor:url(http://st.f1.vnecdn.net/responsive/js/utils/slideshow/css/slideshow/images/icons/zoom_cursor.png), auto; float:none; line-height:0; margin:0px; max-width:100%; padding:0px\\" /><a class=\\"btn_icon_show_slide_show\\" href=\\"http://doisong.vnexpress.net/photo/khong-gian-song/thiet-ke-tien-nghi-ma-tiet-kiem-trong-can-ho-gia-dinh-tre-3208920.html#\\" style=\\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); text-decoration: none; outline: 1px; height: 28px; width: 28px; display: block; position: absolute; right: 0px; top: 0px; background: url(http://st.f3.vnecdn.net/responsive/c/v6/images/graphics/icon_total_01.png) -178px -21px no-repeat;\\">&nbsp;</a></div>\r\n\r\n<div class=\\"desc_cation\\" style=\\"margin: 0px; padding: 10px 13.1875px; width: 633.609375px; float: left; font-size: 12px; background: rgb(245, 245, 245);\\">\r\n<p>Ph&ograve;ng kh&aacute;ch tho&aacute;ng rộng v&agrave; c&oacute; tầm nh&igrave;n đẹp ra cảnh quan b&ecirc;n ngo&agrave;i. Những chiếc gối lười được sử dụng thay cho sofa ph&ograve;ng kh&aacute;ch truyền thống để dễ d&agrave;ng di chuyển v&agrave; th&acirc;n thiện hơn với trẻ nhỏ.</p>\r\n</div>\r\n\r\n<div class=\\"clear\\" style=\\"margin: 0px; padding: 0px; clear: both; font-size: 0px; line-height: 0;\\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\\"item_slide_show\\" style=\\"margin: 0px auto 10px; padding: 0px; clear: both; width: 660.015625px;\\">\r\n<div class=\\"block_thumb_slide_show\\" style=\\"margin: 0px; padding: 0px; width: 660.015625px; float: left; position: relative; text-align: center; font-size: 0px; line-height: 0;\\"><img class=\\"left\\" data-component-caption=\\"&lt;p&gt;\r\n	Tính chất linh hoạt và đa năng của không gian được kiến trúc sư áp dụng sáng tạo. Phòng ngủ thứ ba ban đầu được thay đổi để trở thành không gian vui chơi của trẻ nhỏ hoặc là phòng sinh hoạt chung của gia đình nối liền với phòng khách và phòng ăn.&lt;/p&gt;\\" data-reference-id=\\"22488805\\" id=\\"vne_slide_image_3\\" src=\\"http://c1.f14.img.vnecdn.net/2015/05/04/P-P-Art-Wall-04-1430729993_660x0.jpg\\" style=\\"border:0px; cursor:url(http://st.f1.vnecdn.net/responsive/js/utils/slideshow/css/slideshow/images/icons/zoom_cursor.png), auto; float:none; line-height:0; margin:0px; max-width:100%; padding:0px\\" /><a class=\\"btn_icon_show_slide_show\\" href=\\"http://doisong.vnexpress.net/photo/khong-gian-song/thiet-ke-tien-nghi-ma-tiet-kiem-trong-can-ho-gia-dinh-tre-3208920.html#\\" style=\\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); text-decoration: none; outline: 1px; height: 28px; width: 28px; display: block; position: absolute; right: 0px; top: 0px; background: url(http://st.f3.vnecdn.net/responsive/c/v6/images/graphics/icon_total_01.png) -178px -21px no-repeat;\\">&nbsp;</a></div>\r\n\r\n<div class=\\"desc_cation\\" style=\\"margin: 0px; padding: 10px 13.1875px; width: 633.609375px; float: left; font-size: 12px; background: rgb(245, 245, 245);\\">\r\n<p>T&iacute;nh chất linh hoạt v&agrave; đa năng của kh&ocirc;ng gian được kiến tr&uacute;c sư &aacute;p dụng s&aacute;ng tạo. Ph&ograve;ng ngủ thứ ba ban đầu được thay đổi để trở th&agrave;nh kh&ocirc;ng gian vui chơi của trẻ nhỏ hoặc l&agrave; ph&ograve;ng sinh hoạt chung của gia đ&igrave;nh nối liền với ph&ograve;ng kh&aacute;ch v&agrave; ph&ograve;ng ăn.</p>\r\n</div>\r\n\r\n<div class=\\"clear\\" style=\\"margin: 0px; padding: 0px; clear: both; font-size: 0px; line-height: 0;\\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\\"item_slide_show\\" style=\\"margin: 0px auto 10px; padding: 0px; clear: both; width: 660.015625px;\\">\r\n<div class=\\"block_thumb_slide_show\\" style=\\"margin: 0px; padding: 0px; width: 660.015625px; float: left; position: relative; text-align: center; font-size: 0px; line-height: 0;\\"><img class=\\"left\\" data-component-caption=\\"&lt;p&gt;\r\n	Bên cạnh đó, không gian đa năng này có thể biến đổi thành một phòng ngủ phụ cho người giúp việc hoặc khách ngủ qua đêm nhờ thiết kế vật dụng nội thất thông minh và hệ màn vải linh hoạt.&lt;/p&gt;\\" data-reference-id=\\"22488806\\" id=\\"vne_slide_image_4\\" src=\\"http://c1.f13.img.vnecdn.net/2015/05/04/P-P-Art-Wall-05-1430729993_660x0.jpg\\" style=\\"border:0px; cursor:url(http://st.f1.vnecdn.net/responsive/js/utils/slideshow/css/slideshow/images/icons/zoom_cursor.png), auto; float:none; line-height:0; margin:0px; max-width:100%; padding:0px\\" /><a class=\\"btn_icon_show_slide_show\\" href=\\"http://doisong.vnexpress.net/photo/khong-gian-song/thiet-ke-tien-nghi-ma-tiet-kiem-trong-can-ho-gia-dinh-tre-3208920.html#\\" style=\\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); text-decoration: none; outline: 1px; height: 28px; width: 28px; display: block; position: absolute; right: 0px; top: 0px; background: url(http://st.f3.vnecdn.net/responsive/c/v6/images/graphics/icon_total_01.png) -178px -21px no-repeat;\\">&nbsp;</a></div>\r\n\r\n<div class=\\"desc_cation\\" style=\\"margin: 0px; padding: 10px 13.1875px; width: 633.609375px; float: left; font-size: 12px; background: rgb(245, 245, 245);\\">\r\n<p>B&ecirc;n cạnh đ&oacute;, kh&ocirc;ng gian đa năng n&agrave;y c&oacute; thể biến đổi th&agrave;nh một ph&ograve;ng ngủ phụ cho người gi&uacute;p việc hoặc kh&aacute;ch ngủ qua đ&ecirc;m nhờ thiết kế vật dụng nội thất th&ocirc;ng minh v&agrave; hệ m&agrave;n vải linh hoạt.</p>\r\n</div>\r\n\r\n<div class=\\"clear\\" style=\\"margin: 0px; padding: 0px; clear: both; font-size: 0px; line-height: 0;\\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\\"item_slide_show\\" style=\\"margin: 0px auto 10px; padding: 0px; clear: both; width: 660.015625px;\\">\r\n<div class=\\"block_thumb_slide_show\\" style=\\"margin: 0px; padding: 0px; width: 660.015625px; float: left; position: relative; text-align: center; font-size: 0px; line-height: 0;\\"><img class=\\"left\\" data-component-caption=\\"&lt;p&gt;\r\n	Bức tường sơn trắng ở phòng đa năng cũng là màn chiếu phim lớn cho nhu cầu giải trí tại gia với máy chiếu thông dụng. Ngoài ra, thiết kế linh hoạt còn được thể hiện ở những vật dụng nội thất như bàn ăn có bánh xe để dễ dàng di chuyển hay sân phơi tận dụng làm chỗ cho những loại cây cảnh sinh động và dễ chăm sóc.&lt;/p&gt;\\" data-reference-id=\\"22488807\\" id=\\"vne_slide_image_5\\" src=\\"http://c1.f15.img.vnecdn.net/2015/05/04/P-P-Art-Wall-06-1430729993_660x0.jpg\\" style=\\"border:0px; cursor:url(http://st.f1.vnecdn.net/responsive/js/utils/slideshow/css/slideshow/images/icons/zoom_cursor.png), auto; float:none; line-height:0; margin:0px; max-width:100%; padding:0px\\" /><a class=\\"btn_icon_show_slide_show\\" href=\\"http://doisong.vnexpress.net/photo/khong-gian-song/thiet-ke-tien-nghi-ma-tiet-kiem-trong-can-ho-gia-dinh-tre-3208920.html#\\" style=\\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); text-decoration: none; outline: 1px; height: 28px; width: 28px; display: block; position: absolute; right: 0px; top: 0px; background: url(http://st.f3.vnecdn.net/responsive/c/v6/images/graphics/icon_total_01.png) -178px -21px no-repeat;\\">&nbsp;</a></div>\r\n\r\n<div class=\\"desc_cation\\" style=\\"margin: 0px; padding: 10px 13.1875px; width: 633.609375px; float: left; font-size: 12px; background: rgb(245, 245, 245);\\">\r\n<p>Bức tường sơn trắng ở ph&ograve;ng đa năng cũng l&agrave; m&agrave;n chiếu phim lớn cho nhu cầu giải tr&iacute; tại gia với m&aacute;y chiếu th&ocirc;ng dụng. Ngo&agrave;i ra, thiết kế linh hoạt c&ograve;n được thể hiện ở những vật dụng nội thất như b&agrave;n ăn c&oacute; b&aacute;nh xe để dễ d&agrave;ng di chuyển hay s&acirc;n phơi tận dụng l&agrave;m chỗ cho những loại c&acirc;y cảnh sinh động v&agrave; dễ chăm s&oacute;c.</p>\r\n</div>\r\n\r\n<div class=\\"clear\\" style=\\"margin: 0px; padding: 0px; clear: both; font-size: 0px; line-height: 0;\\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\\"item_slide_show\\" style=\\"margin: 0px auto 10px; padding: 0px; clear: both; width: 660.015625px;\\">\r\n<div class=\\"block_thumb_slide_show\\" style=\\"margin: 0px; padding: 0px; width: 660.015625px; float: left; position: relative; text-align: center; font-size: 0px; line-height: 0;\\"><img class=\\"left\\" data-component-caption=\\"&lt;p&gt;\r\n	Kiến trúc sư thiết kế các vách tường là nơi trưng bày mang tính nghệ thuật như bức tường treo bộ hình phong cảnh đẹp do chính chủ nhân thực hiện. Vách kính ốp tường bếp cũng tích hợp với hình panorama gắn bó với những nơi chốn kỷ niệm của chủ nhà.&lt;/p&gt;\\" data-reference-id=\\"22488808\\" id=\\"vne_slide_image_6\\" src=\\"http://c1.f16.img.vnecdn.net/2015/05/04/P-P-Art-Wall-07-1430729994_660x0.jpg\\" style=\\"border:0px; cursor:url(http://st.f1.vnecdn.net/responsive/js/utils/slideshow/css/slideshow/images/icons/zoom_cursor.png), auto; float:none; line-height:0; margin:0px; max-width:100%; padding:0px\\" /><a class=\\"btn_icon_show_slide_show\\" href=\\"http://doisong.vnexpress.net/photo/khong-gian-song/thiet-ke-tien-nghi-ma-tiet-kiem-trong-can-ho-gia-dinh-tre-3208920.html#\\" style=\\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); text-decoration: none; outline: 1px; height: 28px; width: 28px; display: block; position: absolute; right: 0px; top: 0px; background: url(http://st.f3.vnecdn.net/responsive/c/v6/images/graphics/icon_total_01.png) -178px -21px no-repeat;\\">&nbsp;</a></div>\r\n\r\n<div class=\\"desc_cation\\" style=\\"margin: 0px; padding: 10px 13.1875px; width: 633.609375px; float: left; font-size: 12px; background: rgb(245, 245, 245);\\">\r\n<p>Kiến tr&uacute;c sư thiết kế c&aacute;c v&aacute;ch tường l&agrave; nơi trưng b&agrave;y mang t&iacute;nh nghệ thuật như bức tường treo bộ h&igrave;nh phong cảnh đẹp do ch&iacute;nh chủ nh&acirc;n thực hiện. V&aacute;ch k&iacute;nh ốp tường bếp cũng t&iacute;ch hợp với h&igrave;nh panorama gắn b&oacute; với những nơi chốn kỷ niệm của chủ nh&agrave;.</p>\r\n</div>\r\n\r\n<div class=\\"clear\\" style=\\"margin: 0px; padding: 0px; clear: both; font-size: 0px; line-height: 0;\\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\\"item_slide_show\\" style=\\"margin: 0px auto 10px; padding: 0px; clear: both; width: 660.015625px;\\">\r\n<div class=\\"block_thumb_slide_show\\" style=\\"margin: 0px; padding: 0px; width: 660.015625px; float: left; position: relative; text-align: center; font-size: 0px; line-height: 0;\\"><img class=\\"left\\" data-component-caption=\\"&lt;p&gt;\r\n	Phòng ngủ trẻ em có tông màu trung tính làm nền cho các món đồ chơi hay chăn ga màu sắc sinh động và dễ dàng thay đổi. Phòng vệ sinh ban đầu được chia thành phòng tắm và phòng vệ sinh riêng biệt để tăng tính tiện nghi, đặc biệt là với một gia đình có con nhỏ. Các cửa sổ và vách kính được bổ sung thay thế cho các vách tường gạch để lấy sáng và thông thoáng tự nhiên vào phòng tắm, vệ sinh và bếp.&lt;/p&gt;\\" data-reference-id=\\"22488809\\" id=\\"vne_slide_image_7\\" src=\\"http://c1.f14.img.vnecdn.net/2015/05/04/P-P-Art-Wall-08-1430729994_660x0.jpg\\" style=\\"border:0px; cursor:url(http://st.f1.vnecdn.net/responsive/js/utils/slideshow/css/slideshow/images/icons/zoom_cursor.png), auto; float:none; line-height:0; margin:0px; max-width:100%; padding:0px\\" /><a class=\\"btn_icon_show_slide_show\\" href=\\"http://doisong.vnexpress.net/photo/khong-gian-song/thiet-ke-tien-nghi-ma-tiet-kiem-trong-can-ho-gia-dinh-tre-3208920.html#\\" style=\\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); text-decoration: none; outline: 1px; height: 28px; width: 28px; display: block; position: absolute; right: 0px; top: 0px; background: url(http://st.f3.vnecdn.net/responsive/c/v6/images/graphics/icon_total_01.png) -178px -21px no-repeat;\\">&nbsp;</a></div>\r\n\r\n<div class=\\"desc_cation\\" style=\\"margin: 0px; padding: 10px 13.1875px; width: 633.609375px; float: left; font-size: 12px; background: rgb(245, 245, 245);\\">\r\n<p>Ph&ograve;ng ngủ trẻ em c&oacute; t&ocirc;ng m&agrave;u trung t&iacute;nh l&agrave;m nền cho c&aacute;c m&oacute;n đồ chơi hay chăn ga m&agrave;u sắc sinh động v&agrave; dễ d&agrave;ng thay đổi. Ph&ograve;ng vệ sinh ban đầu được chia th&agrave;nh ph&ograve;ng tắm v&agrave; ph&ograve;ng vệ sinh ri&ecirc;ng biệt để tăng t&iacute;nh tiện nghi, đặc biệt l&agrave; với một gia đ&igrave;nh c&oacute; con nhỏ. C&aacute;c cửa sổ v&agrave; v&aacute;ch k&iacute;nh được bổ sung thay thế cho c&aacute;c v&aacute;ch tường gạch để lấy s&aacute;ng v&agrave; th&ocirc;ng tho&aacute;ng tự nhi&ecirc;n v&agrave;o ph&ograve;ng tắm, vệ sinh v&agrave; bếp.</p>\r\n</div>\r\n\r\n<div class=\\"clear\\" style=\\"margin: 0px; padding: 0px; clear: both; font-size: 0px; line-height: 0;\\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\\"item_slide_show\\" style=\\"margin: 0px auto 10px; padding: 0px; clear: both; width: 660.015625px;\\">\r\n<div class=\\"block_thumb_slide_show\\" style=\\"margin: 0px; padding: 0px; width: 660.015625px; float: left; position: relative; text-align: center; font-size: 0px; line-height: 0;\\"><img class=\\"left\\" data-component-caption=\\"&lt;p&gt;\r\n	Bộ chăn ga màu đỏ làm điểm nhấn thị giác cho phòng ngủ chính có phong cách tối giản với các tông trắng, đen và xám. Rèm vải và tường màu trắng tương phản với chất liệu sàn gỗ và bê tông trần. Bệ cửa sổ lớn ốp đá trắng cũng là nơi thư giãn với tầm nhìn rộng mở ra cảnh quan thiên nhiên bên ngoài.&lt;/p&gt;\\" data-reference-id=\\"22488810\\" id=\\"vne_slide_image_8\\" src=\\"http://c1.f13.img.vnecdn.net/2015/05/04/P-P-Art-Wall-09-1430729994_660x0.jpg\\" style=\\"border:0px; cursor:url(http://st.f1.vnecdn.net/responsive/js/utils/slideshow/css/slideshow/images/icons/zoom_cursor.png), auto; float:none; line-height:0; margin:0px; max-width:100%; padding:0px\\" /><a class=\\"btn_icon_show_slide_show\\" href=\\"http://doisong.vnexpress.net/photo/khong-gian-song/thiet-ke-tien-nghi-ma-tiet-kiem-trong-can-ho-gia-dinh-tre-3208920.html#\\" style=\\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); text-decoration: none; outline: 1px; height: 28px; width: 28px; display: block; position: absolute; right: 0px; top: 0px; background: url(http://st.f3.vnecdn.net/responsive/c/v6/images/graphics/icon_total_01.png) -178px -21px no-repeat;\\">&nbsp;</a></div>\r\n\r\n<div class=\\"desc_cation\\" style=\\"margin: 0px; padding: 10px 13.1875px; width: 633.609375px; float: left; font-size: 12px; background: rgb(245, 245, 245);\\">\r\n<p>Bộ chăn ga m&agrave;u đỏ l&agrave;m điểm nhấn thị gi&aacute;c cho ph&ograve;ng ngủ ch&iacute;nh c&oacute; phong c&aacute;ch tối giản với c&aacute;c t&ocirc;ng trắng, đen v&agrave; x&aacute;m. R&egrave;m vải v&agrave; tường m&agrave;u trắng tương phản với chất liệu s&agrave;n gỗ v&agrave; b&ecirc; t&ocirc;ng trần. Bệ cửa sổ lớn ốp đ&aacute; trắng cũng l&agrave; nơi thư gi&atilde;n với tầm nh&igrave;n rộng mở ra cảnh quan thi&ecirc;n nhi&ecirc;n b&ecirc;n ngo&agrave;i.</p>\r\n</div>\r\n\r\n<div class=\\"clear\\" style=\\"margin: 0px; padding: 0px; clear: both; font-size: 0px; line-height: 0;\\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\\"item_slide_show\\" style=\\"margin: 0px auto 10px; padding: 0px; clear: both; width: 660.015625px;\\">\r\n<div class=\\"block_thumb_slide_show\\" style=\\"margin: 0px; padding: 0px; width: 660.015625px; float: left; position: relative; text-align: center; font-size: 0px; line-height: 0;\\"><img class=\\"left\\" data-component-caption=\\"&lt;p&gt;\r\n	Một chi tiết đặc biệt nữa là vách đầu giường cũng là hệ cửa gỗ linh hoạt che cửa sổ với hình chụp chân dung các nữ diễn viên mà chủ nhân căn hộ yêu thích.&lt;/p&gt;\\" data-reference-id=\\"22488811\\" id=\\"vne_slide_image_9\\" src=\\"http://c1.f14.img.vnecdn.net/2015/05/04/P-P-Art-Wall-10-1430729995_660x0.jpg\\" style=\\"border:0px; cursor:url(http://st.f1.vnecdn.net/responsive/js/utils/slideshow/css/slideshow/images/icons/zoom_cursor.png), auto; float:none; line-height:0; margin:0px; max-width:100%; padding:0px\\" /><a class=\\"btn_icon_show_slide_show\\" href=\\"http://doisong.vnexpress.net/photo/khong-gian-song/thiet-ke-tien-nghi-ma-tiet-kiem-trong-can-ho-gia-dinh-tre-3208920.html#\\" style=\\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); text-decoration: none; outline: 1px; height: 28px; width: 28px; display: block; position: absolute; right: 0px; top: 0px; background: url(http://st.f3.vnecdn.net/responsive/c/v6/images/graphics/icon_total_01.png) -178px -21px no-repeat;\\">&nbsp;</a></div>\r\n\r\n<div class=\\"desc_cation\\" style=\\"margin: 0px; padding: 10px 13.1875px; width: 633.609375px; float: left; font-size: 12px; background: rgb(245, 245, 245);\\">\r\n<p>Một chi tiết đặc biệt nữa l&agrave; v&aacute;ch đầu giường cũng l&agrave; hệ cửa gỗ linh hoạt che cửa sổ với h&igrave;nh chụp ch&acirc;n dung c&aacute;c nữ diễn vi&ecirc;n m&agrave; chủ nh&acirc;n căn hộ y&ecirc;u th&iacute;ch.</p>\r\n</div>\r\n\r\n<div class=\\"clear\\" style=\\"margin: 0px; padding: 0px; clear: both; font-size: 0px; line-height: 0;\\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\\"item_slide_show\\" style=\\"margin: 0px auto 10px; padding: 0px; clear: both; width: 660.015625px;\\">\r\n<div class=\\"block_thumb_slide_show\\" style=\\"margin: 0px; padding: 0px; width: 660.015625px; float: left; position: relative; text-align: center; font-size: 0px; line-height: 0;\\"><img class=\\"left\\" data-component-caption=\\"&lt;p&gt;\r\n	Phòng ngủ chính và phòng thay đồ được ngăn chia khéo léo bởi hệ rèm voan trắng nhẹ nhàng và linh hoạt nhằm đáp ứng tính chất sang trọng, tiện nghi và đồng thời cũng mang lại nhiều cảm xúc.&lt;/p&gt;\\" data-reference-id=\\"22488812\\" id=\\"vne_slide_image_10\\" src=\\"http://c1.f13.img.vnecdn.net/2015/05/04/P-P-Art-Wall-11-1430729995_660x0.jpg\\" style=\\"border:0px; cursor:url(http://st.f1.vnecdn.net/responsive/js/utils/slideshow/css/slideshow/images/icons/zoom_cursor.png), auto; float:none; line-height:0; margin:0px; max-width:100%; padding:0px\\" /><a class=\\"btn_icon_show_slide_show\\" href=\\"http://doisong.vnexpress.net/photo/khong-gian-song/thiet-ke-tien-nghi-ma-tiet-kiem-trong-can-ho-gia-dinh-tre-3208920.html#\\" style=\\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); text-decoration: none; outline: 1px; height: 28px; width: 28px; display: block; position: absolute; right: 0px; top: 0px; background: url(http://st.f3.vnecdn.net/responsive/c/v6/images/graphics/icon_total_01.png) -178px -21px no-repeat;\\">&nbsp;</a></div>\r\n\r\n<div class=\\"desc_cation\\" style=\\"margin: 0px; padding: 10px 13.1875px; width: 633.609375px; float: left; font-size: 12px; background: rgb(245, 245, 245);\\">\r\n<p>Ph&ograve;ng ngủ ch&iacute;nh v&agrave; ph&ograve;ng thay đồ được ngăn chia kh&eacute;o l&eacute;o bởi hệ r&egrave;m voan trắng nhẹ nh&agrave;ng v&agrave; linh hoạt nhằm đ&aacute;p ứng t&iacute;nh chất sang trọng, tiện nghi v&agrave; đồng thời cũng mang lại nhiều cảm x&uacute;c.</p>\r\n</div>\r\n\r\n<div class=\\"clear\\" style=\\"margin: 0px; padding: 0px; clear: both; font-size: 0px; line-height: 0;\\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\\"item_slide_show\\" style=\\"margin: 0px auto 10px; padding: 0px; clear: both; width: 660.015625px;\\">\r\n<div class=\\"block_thumb_slide_show\\" style=\\"margin: 0px; padding: 0px; width: 660.015625px; float: left; position: relative; text-align: center; font-size: 0px; line-height: 0;\\"><img class=\\"left\\" data-component-caption=\\"&lt;p&gt;\r\n	Phòng tắm chính được cải tạo lại với các ô cửa sổ ngang tạo tầm nhìn sinh động ra khoảng sân vườn cây xanh bên ngoài, đồng thời tăng cường thông thoáng và ánh sáng tự nhiên một cách tiết kiệm nhất. Kiến trúc sư cũng đề xuất sử dụng lại một số trang thiết bị và vật liệu hiện trạng ban đầu để tiết kiệm chi phí. Hầu hết các thiết bị điện và phòng tắm được tái sử dụng lại, các cửa đi gỗ được sơn lại màu trắng để tái sử dụng trong không gian mới.&lt;/p&gt;\\" data-reference-id=\\"22488813\\" id=\\"vne_slide_image_11\\" src=\\"http://c1.f15.img.vnecdn.net/2015/05/04/P-P-Art-Wall-12-1430729995_660x0.jpg\\" style=\\"border:0px; cursor:url(http://st.f1.vnecdn.net/responsive/js/utils/slideshow/css/slideshow/images/icons/zoom_cursor.png), auto; float:none; line-height:0; margin:0px; max-width:100%; padding:0px\\" /><a class=\\"btn_icon_show_slide_show\\" href=\\"http://doisong.vnexpress.net/photo/khong-gian-song/thiet-ke-tien-nghi-ma-tiet-kiem-trong-can-ho-gia-dinh-tre-3208920.html#\\" style=\\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); text-decoration: none; outline: 1px; height: 28px; width: 28px; display: block; position: absolute; right: 0px; top: 0px; background: url(http://st.f3.vnecdn.net/responsive/c/v6/images/graphics/icon_total_01.png) -178px -21px no-repeat;\\">&nbsp;</a></div>\r\n\r\n<div class=\\"desc_cation\\" style=\\"margin: 0px; padding: 10px 13.1875px; width: 633.609375px; float: left; font-size: 12px; background: rgb(245, 245, 245);\\">\r\n<p>Ph&ograve;ng tắm ch&iacute;nh được cải tạo lại với c&aacute;c &ocirc; cửa sổ ngang tạo tầm nh&igrave;n sinh động ra khoảng s&acirc;n vườn c&acirc;y xanh b&ecirc;n ngo&agrave;i, đồng thời tăng cường th&ocirc;ng tho&aacute;ng v&agrave; &aacute;nh s&aacute;ng tự nhi&ecirc;n một c&aacute;ch tiết kiệm nhất. Kiến tr&uacute;c sư cũng đề xuất sử dụng lại một số trang thiết bị v&agrave; vật liệu hiện trạng ban đầu để tiết kiệm chi ph&iacute;. Hầu hết c&aacute;c thiết bị điện v&agrave; ph&ograve;ng tắm được t&aacute;i sử dụng lại, c&aacute;c cửa đi gỗ được sơn lại m&agrave;u trắng để t&aacute;i sử dụng trong kh&ocirc;ng gian mới.</p>\r\n</div>\r\n\r\n<div class=\\"clear\\" style=\\"margin: 0px; padding: 0px; clear: both; font-size: 0px; line-height: 0;\\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\\"item_slide_show\\" style=\\"margin: 0px auto 10px; padding: 0px; clear: both; width: 450px;\\">\r\n<div class=\\"block_thumb_slide_show\\" style=\\"margin: 0px; padding: 0px; width: 450px; float: left; position: relative; text-align: center; font-size: 0px; line-height: 0;\\">&nbsp;</div>\r\n\r\n<div class=\\"desc_cation\\" style=\\"margin: 0px; padding: 10px 9px; width: 432px; float: left; font-size: 12px; background: rgb(245, 245, 245);\\">\r\n<p>C&aacute;c vật liệu nội thất mới của căn hộ cũng mang t&iacute;nh kinh tế cao với vật dụng nội thất bằng gỗ c&ocirc;ng nghiệp gi&aacute; cả phải chăng, c&aacute;c bức r&egrave;m vải linh hoạt v&agrave; tiện dụng thay thế cho c&aacute;c v&aacute;ch tường v&agrave; cửa, hệ thống đường ống kỹ thuật cũng được t&iacute;nh to&aacute;n để tiết kiệm chi ph&iacute; nhất.</p>\r\n\r\n<p>Giải ph&aacute;p thiết kế của căn hộ n&agrave;y l&agrave; một khoản đầu tư hợp l&yacute; với khả năng t&agrave;i ch&iacute;nh của chủ nh&agrave;. Đồng thời, với phong c&aacute;ch thiết kế gi&agrave;u c&aacute; t&iacute;nh, hiện đại, linh hoạt v&agrave; đa năng, kiến tr&uacute;c sư đ&atilde; đem lại cho gia đ&igrave;nh gia chủ một gi&aacute; trị mới về lối sống v&agrave; t&iacute;nh tiện nghi nhiều hơn so với khoản đầu tư ban đầu.</p>\r\n</div>\r\n\r\n<div class=\\"clear\\" style=\\"margin: 0px; padding: 0px; clear: both; font-size: 0px; line-height: 0;\\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\\"fck_detail width_common\\" style=\\"margin: 0px; padding: 0px 13.1875px 10px 0px; width: 646.8125px; float: left; overflow: hidden; font-stretch: normal; font-size: 14px; color: rgb(51, 51, 51);\\">\r\n<p style=\\"text-align:right\\"><strong>Theo Vnexpress.net</strong><br />\r\n<em>Ảnh:</em><strong><em>&nbsp;</em>P+P Design &amp; Construction, Quang Trần</strong></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 0, '2015-05-07 13:07:29', '', 1, 'a:6:{s:6:"photos";a:0:{}s:6:"videos";a:0:{}s:5:"files";a:0:{}s:11:"user_upload";s:8:"hungphat";s:11:"user_update";s:8:"hungphat";s:6:"avatar";s:47:"1889816044_P-P-Art-Wall-01-1430729992_660x0.jpg";}', 0, 0),
(25, 1, 0, '7-bi-quyet-tao-cam-giac-thu-thai-tai-nha', '7 bí quyết tạo cảm giác thư thái tại nhà', 'thu thai, cam giac thu thai, thoai mai', 'thu thai, cam giac thu thai, thoai mai', '<div class=\\"title_news\\" style=\\"margin: 10px 0px 0px; padding: 0px 0px 10px; width: 480.015625px; float: left; font-family: arial; font-size: 12px; line-height: normal;\\">\r\n<div class=\\"title_news\\" style=\\"margin: 10px 0px 0px; padding: 0px 0px 10px; width: 480.015625px; float: left; font-family: arial; font-size: 12px; line-height: normal;\\">\r\n<h1>7 b&iacute; quyết tạo cảm gi&aacute;c thư th&aacute;i tại nh&agrave;</h1>\r\n</div>\r\n\r\n<div class=\\"short_intro txt_666\\" style=\\"margin: 0px; padding: 0px 0px 10px; color: rgb(68, 68, 68); font-weight: 700; font-stretch: normal; font-size: 14px; line-height: 18px; font-family: arial; width: 480.015625px; float: left; text-rendering: geometricPrecision;\\">H&atilde;y bắt đầu bằng việc sắp xếp lại đồ đạc, tạo một g&oacute;c nh&igrave;n đẹp cho ng&ocirc;i nh&agrave; hay giảm &aacute;nh s&aacute;ng đ&egrave;n v&agrave;o ban đ&ecirc;m&hellip;</div>\r\n\r\n<div class=\\"fck_detail width_common\\" style=\\"margin: 0px; padding: 0px 9.59375px 10px 0px; width: 470.40625px; float: left; overflow: hidden; font-stretch: normal; font-size: 14px; line-height: normal; font-family: arial;\\">\r\n<p><strong>1. Sắp xếp đồ đạc</strong></p>\r\n\r\n<p>Đồ đạc lộn xộn sẽ khiến cho d&ograve;ng chảy năng lượng trong nh&agrave; bị mắc kẹt, g&acirc;y rối loạn cảm x&uacute;c v&agrave; tạo ra những căng thẳng kh&ocirc;ng cần thiết. H&atilde;y thu dọn v&agrave; bỏ v&agrave;o kho những m&oacute;n đồ chưa d&ugrave;ng đến. Xếp gọn quần &aacute;o kh&ocirc;ng mặc trong nhiều năm v&agrave; bỏ những đồ vật đ&atilde; cũ, hỏng. H&atilde;y tạo một kh&ocirc;ng gian thật tho&aacute;ng đ&atilde;ng trong ch&iacute;nh ng&ocirc;i nh&agrave; của bạn.</p>\r\n\r\n<p><strong>2. T&igrave;m vui trong những c&ocirc;ng việc tẻ nhạt</strong></p>\r\n\r\n<p>Nếu c&ocirc;ng việc nh&agrave; khiến bạn cảm thấy kh&ocirc;ng thoải m&aacute;i th&igrave; h&atilde;y thử bật bản nhạc y&ecirc;u th&iacute;ch trong khi rửa b&aacute;t, lau dọn nh&agrave; cửa&hellip; Nếu bạn gh&eacute;t việc giặt giũ th&igrave; c&oacute; thể mua một chiếc giỏ đựng quần &aacute;o thật đẹp để tạo cảm hứng mới trong những c&ocirc;ng việc đ&atilde; qu&aacute; quen thuộc.</p>\r\n\r\n<table align=\\"center\\" border=\\"0\\" cellpadding=\\"3\\" cellspacing=\\"0\\" class=\\"tplCaption\\" style=\\"margin:0px auto 10px; max-width:100%; padding:0px; width:470px\\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\\"aq1-1345-1399687544.jpg\\" data-natural-=\\"\\" data-pwidth=\\"470.40625\\" data-width=\\"500\\" src=\\"http://m.f13.img.vnecdn.net/2014/05/10/aq1-1345-1399687544.jpg\\" style=\\"border:0px; font-size:0px; line-height:0; margin:0px; max-width:100%; padding:0px; width:470px\\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Ban c&ocirc;ng nh&igrave;n ra cảnh quan thi&ecirc;n nhi&ecirc;n đem lại sức sống cho căn nh&agrave;.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>3. Tạo một g&oacute;c nh&igrave;n đẹp</strong></p>\r\n\r\n<p>Nếu ng&ocirc;i nh&agrave; bạn c&oacute; một g&oacute;c nh&igrave;n đẹp nh&igrave;n ra khung cảnh thi&ecirc;n nhi&ecirc;n hoặc th&agrave;nh phố th&igrave; h&atilde;y để r&egrave;m cửa rộng mở để tạo cảm gi&aacute;c tho&aacute;ng đ&atilde;ng từ ngay b&ecirc;n trong nh&agrave;. Trong trường hợp ng&ocirc;i nh&agrave; bạn kh&ocirc;ng c&oacute; g&oacute;c nh&igrave;n đẹp, h&atilde;y treo một bức tranh lớn c&oacute; phong cảnh rộng lớn hoặc một t&aacute;c phẩm nghệ thuật m&agrave; bạn y&ecirc;u th&iacute;ch.</p>\r\n\r\n<p><strong>4. Giảm &aacute;nh s&aacute;ng đ&egrave;n v&agrave;o ban đ&ecirc;m</strong></p>\r\n\r\n<p>Để &aacute;nh s&aacute;ng trong khi ngủ c&oacute; thể ảnh hưởng đến chất lượng giấc ngủ. Bạn n&ecirc;n bố tr&iacute; &aacute;nh s&aacute;ng thật nhẹ dịu, như vậy cơ thể sẽ cảm thấy thư th&aacute;i v&agrave; dễ ch&igrave;m v&agrave;o giấc ngủ s&acirc;u hơn. Nếu &aacute;nh s&aacute;ng ban ng&agrave;y qu&aacute; ch&oacute;i, c&oacute; thể treo những tấm r&egrave;m vải d&agrave;y để hạn chế độ ch&oacute;i, tạo cảm gi&aacute;c &ecirc;m dịu cho đ&ocirc;i mắt.</p>\r\n\r\n<p><strong>5. Đ&aacute;nh thức mọi gi&aacute;c quan</strong></p>\r\n\r\n<p>Bạn c&oacute; thể bắt đầu bằng việc th&ecirc;m một ch&uacute;t tinh dầu thơm v&agrave;o bồn tắm, lắng nghe những giai điệu nhẹ nh&agrave;ng, sắm th&ecirc;m tấm nệm &ecirc;m tr&ecirc;n ghế sofa v&agrave; đi đ&ocirc;i d&eacute;p mềm mại. H&atilde;y lu&ocirc;n tạo những gi&acirc;y ph&uacute;t nghỉ ngơi thật thoải m&aacute;i tại căn nh&agrave; xinh của m&igrave;nh h&agrave;ng ng&agrave;y.</p>\r\n\r\n<p><strong>6. Y&ecirc;u thi&ecirc;n nhi&ecirc;n hơn</strong></p>\r\n\r\n<p>Thi&ecirc;n nhi&ecirc;n c&oacute; t&aacute;c dụng rất tốt trong việc giải tỏa căng thẳng, khiến t&acirc;m hồn thư th&aacute;i, lắng dịu. Theo nghi&ecirc;n cứu, chỉ với 20 ph&uacute;t đắm ch&igrave;m trong thi&ecirc;n nhi&ecirc;n, cơ thể con người đ&atilde; c&oacute; thể tự l&agrave;m giảm đ&aacute;ng kể c&aacute;c nh&acirc;n tố g&acirc;y căng thẳng, lo lắng. V&igrave; vậy, h&atilde;y th&ecirc;m chậu c&acirc;y cảnh, chậu hoa nhỏ, b&igrave;nh hoa tươi, đ&aacute;, pha l&ecirc;&hellip; để vừa t&ocirc; điểm cho căn nh&agrave; vừa gi&uacute;p bạn cảm thấy nhẹ nh&agrave;ng, thư th&aacute;i.</p>\r\n\r\n<p><strong>7. X&oacute;a tan bầu kh&ocirc;ng kh&iacute; căng thẳng</strong></p>\r\n\r\n<p>Phần lớn ch&uacute;ng ta c&oacute; xu hướng để cảm x&uacute;c ti&ecirc;u cực như tức giận, thất vọng, tổn thương&hellip; tại ch&iacute;nh ng&ocirc;i nh&agrave; của m&igrave;nh m&agrave; kh&ocirc;ng t&igrave;m c&aacute;ch giải quyết ch&uacute;ng. C&ugrave;ng t&acirc;m sự với vợ, chồng, bạn b&egrave;&hellip; để cảm x&uacute;c n&agrave;y được bu&ocirc;ng tỏa, x&oacute;a tan đi bầu kh&ocirc;ng kh&iacute; căng thẳng khi bạn về đến nh&agrave;. Nếu bạn ở một m&igrave;nh, c&oacute; thể xem những bộ phim giải tr&iacute; cao, đọc một cuốn s&aacute;ch, tạp ch&iacute; tươi vui để c&acirc;n bằng lại cảm x&uacute;c.</p>\r\n\r\n<p style=\\"text-align:right\\"><strong>Theo Vnexpress.net</strong></p>\r\n</div>\r\n\r\n<h1>&nbsp;</h1>\r\n</div>', 0, '2015-05-07 13:16:49', '', 1, 'a:5:{s:6:"avatar";s:62:"1113479916_Green-Forest-Wallpaper-green-20036604-1280-1024.jpg";s:6:"photos";a:0:{}s:6:"videos";a:0:{}s:5:"files";a:0:{}s:11:"user_upload";s:8:"hungphat";}', 0, 0);
