(1, 1, 'REGISTRATION_EMAIL', 'Thông tin tài khoản tại {SITENAME}', 's:253:"Xin chào {FULLNAME},<br/><br/>\r\n\r\nCảm ơn bạn đã đăng ký tài khoản tại {SITENAME}. Thông tin tài khoản của bạn như sau:<br/><br/>\r\n\r\nUsername: {USERNAME}<br/>\r\nMật khẩu: {PASSWORD}<br/><br/>\r\n\r\nTrân trọng,<br/>\r\n{SITENAME}";', 'SITENAME,FULLNAME,USERNAME,PASSWORD', 1, 0),
(2, 1, 'ORDER_CONFIRMATION', 'Xác nhận đơn đặt hàng từ {SITENAME}', 's:381:"Xin chào {ORDERCUSNAME},<br/><br/>\r\n\r\nCảm ơn bạn đã đặt hàng tại {SITENAME}. Thông tin đơn hàng của bạn như sau:<br/><br/>\r\n\r\nMã đơn hàng: {ORDERID}<br/>\r\nMật khẩu đơn hàng: {ORDERPASSWORD}<br/><br/>\r\n\r\nBạn có thể xem thông tin đơn hàng bằng cách truy cập vào liên kết sau: {ORDERURL}<br/><br/>\r\n\r\nTrân trọng,<br/>\r\n{SITENAME}";', 'ORDERCUSNAME,ORDERID,ORDERPASSWORD,ORDERURL,SITENAME', 1, 0),
(4, 1, 'ORDER_STATUS_CHANGE', 'Thay đổi thông tin đơn hàng tại {SITENAME}', 's:317:"Xin chào {ORDERCUSNAME},\r\n\r\nTrạng thái đơn hàng {ORDERID} của bạn đã thay đổi, chi tiết như sau:\r\n\r\nTrạng thái cũ: {OLDSTATUS}\r\nTrạng thái mới: {STATUS}\r\n\r\nBạn có thể theo dõi trạng thái đơn hàng bằng cách nhấp vào liên kết sau: {ORDERURL}\r\n\r\nTrân trọng\r\n{SITENAME}";', 'ORDERCUSNAME, ORDERID, ORDERDATE, OLDSTATUS, STATUS, SITENAME', 1, 0),
(6, 1, 'CONTACT_EMAIL', 'Thông tin liên hệ tại {SITENAME}', 's:451:"Xin chào,\r\nBạn nhận được một email liên hệ từ {SITENAME}.\r\nThông tin liên hệ như sau: \r\nHọ tên: {FULLNAME}\r\nĐịa chỉ:{ADDRESS} \r\nEmail: {EMAIL}\r\nĐiện thoại: {TEL}\r\nNội dung: {CONTENT}\r\nVui lòng nhanh chóng liên hệ với khách hàng.\r\nTrân trọng.\r\n{SITENAME}.\r\n\r\nEmail:info@senviet.net.vn\r\nĐịa chỉ: Ấp Voi Lá, thị trấn Bến Lức, huyện Bến Lức, tỉnh Long An\r\nWebsite: www.senviet.net.vn";', 'SITENAME,FULLNAME,ADDRESS,EMAIL,TEL,CONTENT', 1, 0),
(7, 1, 'RESERVATION_EMAIL', 'Thông tin đặt phòng tại {SITENAME}', 's:857:"Xin chào {FULLNAME}<br>\r\nThông tin đặt phòng của bạn đã được gửi đi thành công.<br>\r\nThông tin đặt phòng như sau:<br>\r\n<b>Tên cá nhân, tổ chức: </b>{FULLNAME}<br>\r\n<b>Địa chỉ: </b>{ADDRESS}<br>\r\n<b>Số điện thoại: </b>{TEL}<br>\r\n<b>Số điện thoại di động:</b> {CELL}<br>\r\n<b>Ngày đến:</b>{DATE_ARRIVE}<br>\r\n<b>Ngày đi:</b> {DATE_LEAVE}<br>\r\n<b>Số tiền cần thanh toán:</b> {MONEY} VNĐ<br>\r\nBạn hãy nhấp link dưới đây để theo dỏi tình trạng đơn đặt phòng<br>\r\nLink: {LINK}<br>\r\nCảm ơn bạn đã sử dụng dịch vụ của chúng tôi.<br>\r\n<b>{SITENAME}</b><br>\r\n<b>Địa chỉ:</b> A1-12 Khu Biệt Thự Sài Gòn Pearl, 92 Nguyễn Hữu Cảnh, P.22,Quận Bình Thạnh, TP HCM<br>\r\n<b>Điện thoại:</b> (+84.8) 3830 1234 <b>Fax:</b> (+84.8) 3830 1234";', 'SITENAME,FULLNAME,FULLNAME,ADDRESS,TEL,CELL,DATE_ARRIVE,DATE_LEAVE,MONEY,LINK,SITENAME', 0, 0),
