(104, 1, 52, '', '', '', 'ban-cau-cam-ung-regio-den', 'Bàn cầu cảm ứng REGIO đen', 'gach op tuong, gach 30x60, thiet bi ve sinh, voi nuoc, sen tam, son nuoc, ngoi, thiet bi nha tam, gach lot nen, gach an do', 'Sản phẩm của Inax Việt Nam- Nhật Bản.\r\nKiểu dáng và chi tiết thiết kế trang nhã.\r\nKích thước: 460 x 790 x 540mm\r\nKhi sử dụng vào buổi tối, dù không bật đèn phòng, vẫn có đèn sáng mờ ở bên trong và phía dưới chân bàn cầu.\r\nChức năng phát lại nhữngbản nhạc có chất lượng cao theo phương thức Relax Music biến không gian trong phòng vệ sinh trở thành không gian thư giãn.', '<p>Sản phẩm của Inax Việt Nam- Nhật Bản.</p>\r\n\r\n<p>Kiểu d&aacute;ng v&agrave; chi tiết thiết kế trang nh&atilde;.<br />\r\nK&iacute;ch thước: 460 x 790 x 540mm<br />\r\nKhi sử dụng v&agrave;o buổi tối, d&ugrave; kh&ocirc;ng bật đ&egrave;n ph&ograve;ng, vẫn c&oacute; đ&egrave;n s&aacute;ng mờ ở b&ecirc;n trong v&agrave; ph&iacute;a dưới ch&acirc;n b&agrave;n cầu.<br />\r\nChức năng ph&aacute;t lại nhữngbản nhạc c&oacute; chất lượng cao theo phương thức Relax Music biến kh&ocirc;ng gian trong ph&ograve;ng vệ sinh trở th&agrave;nh kh&ocirc;ng gian thư gi&atilde;n.</p>', '', '124800000', '', 0, 9, '2015-04-18 12:52:34', '2015-04-20 15:07:44', 0, 'a:9:{s:6:"avatar";N;s:6:"photos";a:1:{i:0;s:25:"2043849905_Regio đen.jpg";}s:6:"videos";a:0:{}s:5:"files";a:0:{}s:11:"user_upload";s:8:"hungphat";s:11:"user_update";s:8:"hungphat";s:6:"weight";s:1:"1";s:8:"warranty";s:0:"";s:12:"warranty_des";s:0:"";}', 1, 0, '', '', 0, 0, 1),
(105, 1, 52, '', '', '', 'ban-cau-cam-ung-gc-273', 'Bàn cầu cảm ứng GC 273', 'gach op tuong, gach 30x60, thiet bi ve sinh, voi nuoc, sen tam, son nuoc, ngoi, thiet bi nha tam, gach lot nen, gach an do', 'Sản phẩm của Inax Việt Nam- Nhật Bản.\r\nHệ thống làm sạch không khí giúp ngăn ngừa bụi, vi khuẩn và tẩy những mùi khó chịu.\r\nTự động phát ánh sáng dịu vào ban đêm.\r\nNhững âm thanh nhẹ nhàng sẽ làm cho bạn thư giãn và thoải mái khi sử dụng.', '<p>Sản phẩm của Inax Việt Nam- Nhật Bản.</p>\r\n\r\n<p>Hệ thống l&agrave;m sạch kh&ocirc;ng kh&iacute; gi&uacute;p ngăn ngừa bụi, vi khuẩn v&agrave; tẩy những m&ugrave;i kh&oacute; chịu.<br />\r\nTự động ph&aacute;t &aacute;nh s&aacute;ng dịu v&agrave;o ban đ&ecirc;m.<br />\r\nNhững &acirc;m thanh nhẹ nh&agrave;ng sẽ l&agrave;m cho bạn thư gi&atilde;n v&agrave; thoải m&aacute;i khi sử dụng.</p>\r\n\r\n<p>&nbsp;</p>', '', '69025000', '', 0, 8, '2015-04-18 13:00:13', '2015-04-20 15:06:19', 0, 'a:9:{s:6:"avatar";N;s:6:"photos";a:1:{i:0;s:20:"461486647_GC 273.jpg";}s:6:"videos";a:0:{}s:5:"files";a:0:{}s:11:"user_upload";s:8:"hungphat";s:11:"user_update";s:8:"hungphat";s:6:"weight";s:1:"1";s:8:"warranty";s:0:"";s:12:"warranty_des";s:0:"";}', 1, 0, '', '', 0, 0, 1),
(106, 1, 52, '', '', '', 'ban-cau-gc-4060vn', 'Bàn cầu GC 4060VN', 'gach op tuong, gach 30x60, thiet bi ve sinh, voi nuoc, sen tam, son nuoc, ngoi, thiet bi nha tam, gach lot nen, gach an do, ban cau', 'Sản phẩm của Inax Việt Nam\r\nDạng bàn cầu một khối.\r\nXả xi phông - xoáy hút mạnh mẽ, rửa trôi mọi vết bẩn, làm cho lòng bàn cầu luôn sạch sẽ.\r\nSiêu tiết kiệm nước với 2 mức xả: 5 lít - 3.5 Lít.\r\nCông nghệ chống bám bẩn Proguard.\r\nCông nghệ chống khuẩn HyperKilamic.\r\nNắp và bệ ngồi đóng êm.\r\nĐã bao gồm van chặn nước , đế thải nước .\r\nSản phẩm chỉ có màu trắng.', '<p>Sản phẩm của Inax Việt Nam</p>\r\n\r\n<p>Dạng b&agrave;n cầu một khối.<br />\r\nXả xi ph&ocirc;ng - xo&aacute;y h&uacute;t mạnh mẽ, rửa tr&ocirc;i mọi vết bẩn, l&agrave;m cho l&ograve;ng b&agrave;n cầu lu&ocirc;n sạch sẽ.<br />\r\nSi&ecirc;u tiết kiệm nước với 2 mức xả: 5 l&iacute;t - 3.5 L&iacute;t.<br />\r\nC&ocirc;ng nghệ chống b&aacute;m bẩn Proguard.<br />\r\nC&ocirc;ng nghệ chống khuẩn HyperKilamic.<br />\r\nNắp v&agrave; bệ ngồi đ&oacute;ng &ecirc;m.<br />\r\nĐ&atilde; bao gồm van chặn nước , đế thải nước .<br />\r\nSản phẩm chỉ c&oacute; m&agrave;u trắng.</p>', '', '15500000', '', 0, 48, '2015-04-18 13:13:36', '2015-04-20 15:05:33', 0, 'a:9:{s:6:"avatar";N;s:6:"photos";a:1:{i:0;s:23:"502679852_gc-4060vn.jpg";}s:6:"videos";a:0:{}s:5:"files";a:0:{}s:11:"user_upload";s:8:"hungphat";s:11:"user_update";s:8:"hungphat";s:6:"weight";s:1:"1";s:8:"warranty";s:0:"";s:12:"warranty_des";s:0:"";}', 1, 0, '', '', 0, 0, 1),
(107, 1, 52, '', '', '', 'gc-3058vn', 'GC 3058VN', 'gach op tuong, gach 30x60, thiet bi ve sinh, voi nuoc, sen tam, son nuoc, ngoi, thiet bi nha tam, gach lot nen, gach an do, ban cau', 'Sản phẩm của Inax Việt Nam\r\nCông nghệ xả Eco-X tiết kiệm nước tối ưu, tạo dòng xoáy cực mạnh, cuốn trôi mọi vết bẩn và hạn chế tối đa vi khuẩn, giảm thiểu âm thanh.\r\nSiêu tiết kiệm nước với 2 mức xả: Xả đại 5 lít - Xả tiểu 3.5 Lít.\r\nCông nghệ chống bám bẩn Proguard.\r\nCông nghệ chống khuẩn HyperKilamic.\r\nNắp và bệ ngồi đóng êm.\r\nĐã bao gồm van chặn nước LF-3KE, đế thải nước T-93V.\r\nTiết kiệm nước.', '<p>Sản phẩm của Inax Việt Nam</p>\r\n\r\n<p>C&ocirc;ng nghệ xả Eco-X tiết kiệm nước tối ưu, tạo d&ograve;ng xo&aacute;y cực mạnh, cuốn tr&ocirc;i mọi vết bẩn v&agrave; hạn chế tối đa vi khuẩn, giảm thiểu &acirc;m thanh.<br />\r\nSi&ecirc;u tiết kiệm nước với 2 mức xả: Xả đại 5 l&iacute;t - Xả tiểu 3.5 L&iacute;t.<br />\r\nC&ocirc;ng nghệ chống b&aacute;m bẩn Proguard.<br />\r\nC&ocirc;ng nghệ chống khuẩn HyperKilamic.<br />\r\nNắp v&agrave; bệ ngồi đ&oacute;ng &ecirc;m.<br />\r\nĐ&atilde; bao gồm van chặn nước LF-3KE, đế thải nước T-93V.<br />\r\nTiết kiệm nước.</p>', '', '15000000', '', 0, 49, '2015-04-18 13:27:03', '2015-04-20 15:05:16', 0, 'a:9:{s:6:"avatar";N;s:6:"photos";a:1:{i:0;s:22:"40120564_gc-3058vn.jpg";}s:6:"videos";a:0:{}s:5:"files";a:0:{}s:11:"user_upload";s:8:"hungphat";s:11:"user_update";s:8:"hungphat";s:6:"weight";s:1:"1";s:8:"warranty";s:0:"";s:12:"warranty_des";s:0:"";}', 1, 0, '', '', 0, 0, 1);
