(108, 1, 52, '', '', '', 'gc-2755vn', 'GC 2755VN', 'gach op tuong, gach 30x60, thiet bi ve sinh, voi nuoc, sen tam, son nuoc, ngoi, thiet bi nha tam, gach lot nen, gach an do, ban cau', 'Sản phẩm của Inax Việt Nam\r\nDạng bàn cầu một khối xả thẳng.\r\nXả nhấn 2 nút riêng biệt. Xả đại 6.5 lít - Xả tiểu 4.5 Lít.\r\nCông nghệ chống bám bẩn Proguard.\r\nCông nghệ chống khuẩn HyperKilamic.\r\nĐã bao gồm van vặn khóa, đế thải nước TR-SS.\r\nKỹ thuật xả rửa vành Rim kiểu mới, tiết kiệm nước tối ưu nhưng lại dễ dàng xả rửa và sạch sẽ hơn', '<p>Sản phẩm của Inax Việt Nam</p>\r\n\r\n<p>Dạng b&agrave;n cầu một khối xả thẳng.<br />\r\nXả nhấn 2 n&uacute;t ri&ecirc;ng biệt. Xả đại 6.5 l&iacute;t - Xả tiểu 4.5 L&iacute;t.<br />\r\nC&ocirc;ng nghệ chống b&aacute;m bẩn Proguard.<br />\r\nC&ocirc;ng nghệ chống khuẩn HyperKilamic.<br />\r\nĐ&atilde; bao gồm van vặn kh&oacute;a, đế thải nước TR-SS.<br />\r\nKỹ thuật xả rửa v&agrave;nh Rim kiểu mới, tiết kiệm nước tối ưu nhưng lại dễ d&agrave;ng xả rửa v&agrave; sạch sẽ hơn</p>', '', '14200000', '12.780.000', 0, 50, '2015-04-18 14:20:35', '2015-04-20 15:04:57', 0, 'a:9:{s:6:"avatar";N;s:6:"photos";a:1:{i:0;s:26:"1733470106_gc-2755vn_1.jpg";}s:6:"videos";a:0:{}s:5:"files";a:0:{}s:11:"user_upload";s:8:"hungphat";s:11:"user_update";s:8:"hungphat";s:6:"weight";s:1:"1";s:8:"warranty";s:0:"";s:12:"warranty_des";s:0:"";}', 1, 0, '', '', 0, 0, 1),
